      }}><inlineCode parentName="a">{`assume_role`}</inlineCode></a>{` option. This is an
optional setting that is helpful for a variety of use cases, such as cross
account access.`}</p>
    <h3 {...{
      "id": "buffers--batches"
    }}>{`Buffers & Batches`}</h3>
    <SVG src="/img/buffers-and-batches-partitioned.svg" mdxType="SVG" />
    <p>{`The `}<inlineCode parentName="p">{`aws_s3`}</inlineCode>{` sink buffers & batches data as
shown in the diagram above. You'll notice that Vector treats these concepts
differently, instead of treating them as global concepts, Vector treats them
as sink specific concepts. This isolates sinks, ensuring services disruptions
are contained and `}<a parentName="p" {...{
        "href": "/docs/about/guarantees/"
      }}>{`delivery guarantees`}</a>{` are honored.`}</p>
    <p><em parentName="p">{`Batches`}</em>{` are flushed when 1 of 2 conditions are met:`}</p>
    <ol>
      <li parentName="ol">{`The batch age meets or exceeds the configured `}<a parentName="li" {...{
          "href": "#timeout_secs"
        }}><inlineCode parentName="a">{`timeout_secs`}</inlineCode></a>{`.`}</li>
      <li parentName="ol">{`The batch size meets or exceeds the configured `}<a parentName="li" {...{
          "href": "#max_events"
        }}><inlineCode parentName="a">{`max_events`}</inlineCode></a>{`.`}</li>
    </ol>
    <p><em parentName="p">{`Buffers`}</em>{` are controlled via the `}<a parentName="p" {...{
        "href": "#buffer"
      }}><inlineCode parentName="a">{`buffer.*`}</inlineCode></a>{` options.`}</p>
    <h3 {...{
      "id": "cross-account-object-writing"
    }}>{`Cross account object writing`}</h3>
    <p>{`If you're using Vector to write objects across AWS accounts then you should
consider setting the `}<a parentName="p" {...{
        "href": "#grant_full_control"
      }}><inlineCode parentName="a">{`grant_full_control`}</inlineCode></a>{` option to the bucket owner's
canonical user ID. AWS provides a
`}<a parentName="p" {...{
        "href": "https://docs.aws.amazon.com/AmazonS3/latest/dev/example-walkthroughs-managing-access-example3.html"
      }}>{`full tutorial`}</a>{` for this use case. If
don't know the bucket owner's canoncial ID you can find it by following
`}<a parentName="p" {...{
        "href": "https://docs.aws.amazon.com/general/latest/gr/acct-identifiers.html#FindingCanonicalId"
      }}>{`this tutorial`}</a>{`.`}</p>
    <h3 {...{
      "id": "environment-variables"
    }}>{`Environment Variables`}</h3>
    <p>{`Environment variables are supported through all of Vector's configuration.
Simply add `}<inlineCode parentName="p">{`\${MY_ENV_VAR}`}</inlineCode>{` in your Vector configuration file and the variable
will be replaced before being evaluated.`}</p>
    <p>{`You can learn more in the
`}<a parentName="p" {...{
        "href": "/docs/setup/configuration/#environment-variables"
      }}>{`Environment Variables`}</a>{` section.`}</p>
    <h3 {...{
      "id": "health-checks"
    }}>{`Health Checks`}</h3>
    <p>{`Health checks ensure that the downstream service is accessible and ready to
accept data. This check is performed upon sink initialization.
If the health check fails an error will be logged and Vector will proceed to
start.`}</p>
    <h4 {...{
      "id": "require-health-checks"
    }}>{`Require Health Checks`}</h4>
    <p>{`If you'd like to exit immediately upon a health check failure, you can
pass the `}<inlineCode parentName="p">{`--require-healthy`}</inlineCode>{` flag:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`vector --config /etc/vector/vector.toml --require-healthy
`}</code></pre>
    <h4 {...{
      "id": "disable-health-checks"
    }}>{`Disable Health Checks`}</h4>
    <p>{`If you'd like to disable health checks for this sink you can set the
`}<inlineCode parentName="p">{`healthcheck`}</inlineCode>{` option to `}<inlineCode parentName="p">{`false`}</inlineCode>{`.`}</p>
    <h3 {...{
      "id": "object-access-control-list-acl"
    }}>{`Object access control list (ACL)`}</h3>
    <p>{`AWS S3 supports `}<a parentName="p" {...{
        "href": "https://docs.aws.amazon.com/AmazonS3/latest/dev/acl-overview.html"
      }}>{`access control lists (ACL)`}</a>{` for buckets and
objects. In the context of Vector, only object ACLs are relevant (Vector does
not create or modify buckets). You can set the object level ACL by using one
of the `}<a parentName="p" {...{
        "href": "#acl"
      }}><inlineCode parentName="a">{`acl`}</inlineCode></a>{`, `}<a parentName="p" {...{
        "href": "#grant_full_control"
      }}><inlineCode parentName="a">{`grant_full_control`}</inlineCode></a>{`, `}<a parentName="p" {...{
        "href": "#grant_read"
      }}><inlineCode parentName="a">{`grant_read`}</inlineCode></a>{`, `}<a parentName="p" {...{
        "href": "#grant_read_acp"
      }}><inlineCode parentName="a">{`grant_read_acp`}</inlineCode></a>{`, or
`}<inlineCode parentName="p">{`grant_write_acp`}</inlineCode>{` options.`}</p>
    <h4 {...{
      "id": "acl-vs-the-grant_-options"
    }}><a parentName="h4" {...{
        "href": "#acl"
      }}><inlineCode parentName="a">{`acl`}</inlineCode></a>{` vs the `}<inlineCode parentName="h4">{`grant_*`}</inlineCode>{` options`}</h4>
    <p>{`The `}<inlineCode parentName="p">{`grant_*`}</inlineCode>{` options name a specific entity to grant access to. The `}<a parentName="p" {...{
        "href": "#acl"
      }}><inlineCode parentName="a">{`acl`}</inlineCode></a>{`
options is one of a set of `}<a parentName="p" {...{
        "href": "https://docs.aws.amazon.com/AmazonS3/latest/dev/acl-overview.html#canned-acl"
      }}>{`specific canned ACLs`}</a>{` that
can only name the owner or world.`}</p>
    <h3 {...{
      "id": "object-naming"
    }}>{`Object naming`}</h3>
    <p>{`By default, Vector will name your S3 objects in the following format:`}</p>
    <Tabs block={true} defaultValue="without_compression" values={[{
      label: 'Without Compression',
      value: 'without_compression'
    }, {
      label: 'With Compression',
      value: 'with_compression'
    }]} mdxType="Tabs">
      <TabItem value="without_compression" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-text"
          }}>{`<key_prefix><timestamp>-<uuidv4>.log
`}</code></pre>
        <p>{`For example:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-text"
          }}>{`date=2019-06-18/1560886634-fddd7a0e-fad9-4f7e-9bce-00ae5debc563.log
`}</code></pre>
      </TabItem>
      <TabItem value="with_compression" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-text"
          }}>{`<key_prefix><timestamp>-<uuidv4>.log.gz
`}</code></pre>
        <p>{`For example:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-text"
          }}>{`date=2019-06-18/1560886634-fddd7a0e-fad9-4f7e-9bce-00ae5debc563.log.gz
`}</code></pre>
      </TabItem>
    </Tabs>
    <p>{`Vector appends a `}<a parentName="p" {...{
        "href": "https://en.wikipedia.org/wiki/Universally_unique_identifier#Version_4_(random)"
      }}>{`UUIDV4`}</a>{` token to ensure there are no name
conflicts in the unlikely event 2 Vector instances are writing data at the same
time.`}</p>
    <p>{`You can control the resulting name via the `}<a parentName="p" {...{
        "href": "#key_prefix"
      }}><inlineCode parentName="a">{`key_prefix`}</inlineCode></a>{`, `}<a parentName="p" {...{
        "href": "#filename_time_format"
      }}><inlineCode parentName="a">{`filename_time_format`}</inlineCode></a>{`,
and `}<a parentName="p" {...{
        "href": "#filename_append_uuid"
      }}><inlineCode parentName="a">{`filename_append_uuid`}</inlineCode></a>{` options.`}</p>
    <h3 {...{
      "id": "partitioning"
    }}>{`Partitioning`}</h3>
    <p>{`Partitioning is controlled via the `}<a parentName="p" {...{
        "href": "#key_prefix"
      }}><inlineCode parentName="a">{`key_prefix`}</inlineCode></a>{`
options and allows you to dynamically partition data on the fly.
You'll notice that Vector's `}<a parentName="p" {...{
        "href": "/docs/reference/templating/"
      }}>{`template sytax`}</a>{` is
supported for these options, enabling you to use field values as partition keys.`}</p>
    <h3 {...{
      "id": "rate-limits"
    }}>{`Rate Limits`}</h3>
    <p>{`Vector offers a few levers to control the rate and volume of requests to the
downstream service. Start with the `}<a parentName="p" {...{
        "href": "#rate_limit_duration_secs"
      }}><inlineCode parentName="a">{`rate_limit_duration_secs`}</inlineCode></a>{` and
`}<inlineCode parentName="p">{`rate_limit_num`}</inlineCode>{` options to ensure Vector does not exceed the specified
number of requests in the specified window. You can further control the pace at
which this window is saturated with the `}<a parentName="p" {...{
        "href": "#in_flight_limit"
      }}><inlineCode parentName="a">{`in_flight_limit`}</inlineCode></a>{` option, which
will guarantee no more than the specified number of requests are in-flight at
any given time.`}</p>
    <p>{`Please note, Vector's defaults are carefully chosen and it should be rare that
you need to adjust these. If you found a good reason to do so please share it
with the Vector team by `}<a parentName="p" {...{
        "href": "https://github.com/timberio/vector/issues/new?labels=sink%3A+aws_s3"
      }}>{`opening an issue`}</a>{`.`}</p>
    <h3 {...{
      "id": "retry-policy"
    }}>{`Retry Policy`}</h3>
    <p>{`Vector will retry failed requests (status == `}<inlineCode parentName="p">{`429`}</inlineCode>{`, >= `}<inlineCode parentName="p">{`500`}</inlineCode>{`, and != `}<inlineCode parentName="p">{`501`}</inlineCode>{`).
Other responses will `}<em parentName="p">{`not`}</em>{` be retried. You can control the number of retry
attempts and backoff rate with the `}<a parentName="p" {...{
        "href": "#retry_attempts"
      }}><inlineCode parentName="a">{`retry_attempts`}</inlineCode></a>{` and
`}<inlineCode parentName="p">{`retry_backoff_secs`}</inlineCode>{` options.`}</p>
    <h3 {...{
      "id": "server-side-encryption-sse"
    }}>{`Server-side encryption (SSE)`}</h3>
    <p>{`AWS S3 offers `}<a parentName="p" {...{
        "href": "https://docs.aws.amazon.com/AmazonS3/latest/dev/UsingServerSideEncryption.html"
      }}>{`server-side encryption`}</a>{`. You can apply defaults
at the bucket level or set the encryption at the object level. In the context,
of Vector only the object level is relevant (Vector does not create or modify
buckets). Although, we recommend setting defaults at the bucket level whne
possible. You can explicitly set the object level encryption via the
`}<inlineCode parentName="p">{`server_side_encryption`}</inlineCode>{` option.`}</p>
    <h3 {...{
      "id": "storage-class"
    }}>{`Storage class`}</h3>
    <p>{`AWS S3 offers `}<a parentName="p" {...{
        "href": "https://aws.amazon.com/s3/storage-classes/"
      }}>{`storage classes`}</a>{`. You can apply
defaults, and rules, at the bucket level or set the storage class at the object
level. In the context of Vector only the object level is relevant (Vector does
not create or modify buckets). You can set the storage class via the
`}<inlineCode parentName="p">{`storage_class`}</inlineCode>{` option.`}</p>
    <h3 {...{
      "id": "tags--metadata"
    }}>{`Tags & metadata`}</h3>
    <p>{`Vector currently only supports `}<a parentName="p" {...{
        "href": "https://docs.aws.amazon.com/AmazonS3/latest/user-guide/add-object-tags.html"
      }}>{`AWS S3 object tags`}</a>{` and does
`}<em parentName="p">{`not`}</em>{` support `}<a parentName="p" {...{
        "href": "https://docs.aws.amazon.com/AmazonS3/latest/dev/UsingMetadata.html#object-metadata"
      }}>{`object metadata`}</a>{`. If you require metadata
support see `}<a parentName="p" {...{
        "href": "https://github.com/timberio/vector/issues/1694"
      }}>{`issue #1694`}</a>{`.`}</p>
    <p>{`We believe tags are more flexible since they are separate from the actual S3
object. Youc an freely modify tags without modifying the object. Conversely,
object metadata requires a full rewrite of the object to make changes.`}</p>
    <h3 {...{
      "id": "template-syntax"
    }}>{`Template Syntax`}</h3>
    <p>{`The `}<a parentName="p" {...{
        "href": "#key_prefix"
      }}><inlineCode parentName="a">{`key_prefix`}</inlineCode></a>{` options
support `}<a parentName="p" {...{
        "href": "/docs/reference/templating/"
      }}>{`Vector's template syntax`}</a>{`, enabling dynamic
values derived from the event's data. This syntax accepts
`}<a parentName="p" {...{
        "href": "https://docs.rs/chrono/0.4.11/chrono/format/strftime/index.html#specifiers"
      }}>{`strptime specifiers`}</a>{` as well as the
`}<inlineCode parentName="p">{`{{ field_name }}`}</inlineCode>{` syntax for accessing event fields. For example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-toml",
        "metastring": "title=\"vector.toml\"",
        "title": "\"vector.toml\""
      }}>{`[sinks.my_aws_s3_sink_id]
  # ...
  key_prefix = "date=%F/"
  key_prefix = "date=%F/hour=%H/"
  key_prefix = "year=%Y/month=%m/day=%d/"
  key_prefix = "application_id={{ application_id }}/date=%F/"
  # ...
`}</code></pre>
    <p>{`You can learn more about the complete syntax in the
`}<a parentName="p" {...{
        "href": "/docs/reference/templating/"
      }}>{`templating reference`}</a>{`.`}</p>
    </MDXLayout>;
